<body>
    <style>
        ul {
            list-style: none;
        }

        * {
            -webkit-tap-highlight-color: transparent;
            padding: 0;
        }

        body,
        html {
            background: #5157ff;
            padding: 0;
            margin: 0;
        }

        [v-cloak] {

        .contentnav {
            z-index: 99;
        }

        .contentnav,
        .contentnav>.contentnav-content {
            position: relative;
            width: 100%;
            height: .74rem;
            display: flex;
        }

        .contentnav>.contentnav-content {
            overflow: hidden;
        }

        .contentnav .partnav {
            height: .74rem;
            position: relative;
            overflow: hidden;
            flex: 1;
            background: #fff;
            color: #333;
        }

        .contentnav .partnavlist {
            position: absolute;
            left: 0;
            -webkit-overflow-scrolling: touch;
            background: #fff;
        }

        .contentnav .partnavlist ul {
            position: relative;
            white-space: nowrap;
            font-size: 0;
        }

        .contentnav .partnavlist ul li {
            padding: 0 .15rem;
            height: .74rem;
            line-height: .76rem;
            position: relative;
            display: inline-block;
            color: #333;
            font-size: .26rem;
            text-align: center;
            text-decoration: none;
            cursor: pointer;
            background: #fff;
            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;
        }

        .contentnav .partnavlist ul li:first-child:before {
            content: normal;
        }

        .contentnav .partnavlist ul li.active {
            font-weight: 500;
            color: #5157ff;
        }

        .contentnav .partnavlist ul li.active i {
            display: inline-block;
            width: .22rem;
            transform: translateY(.04rem);
        }

        .contentnav .partnavlist ul li.active i svg .st0 {
            fill-rule: evenodd;
            clip-rule: evenodd;
            fill: currentColor;
        }

        .contentnav .partnavlist ul li.active i svg .st1 {
            fill: currentColor;
        }

        .contentnav .partnavlist.goods-nav-list ul li {
            width: 1.28rem;
        }

        .contentnav .morenav {
            position: relative;
            width: .8rem;
            height: .74rem;
            display: flex;
            justify-content: center;
            align-items: center;
            cursor: pointer;
            background: #fff;
        }

        .contentnav .morenav i {
            font-size: .26rem;
            color: #333;
        }

        .contentnav .opennav {
            position: absolute;
            top: .74rem;
            left: 0;
            width: 100%;
            background: #fff;
        }

            display: flex;
            flex-wrap: wrap;
            justify-content: space-around;
            box-shadow: 0 8px 14px -7px rgba(0, 0, 0, .1);

            letter-spacing: .02rem;

            -ms-user-select: none;

            background: #5a4af4;
        }

        }

            top: 0;
            left: 0;

            height: .74rem;

        }

            width: 100%;
            margin: 0 auto;
        }

        .contentnav-fixed .opennav ul {
            justify-content: normal;
        }

            background: #fff;
            display: flex;
            align-items: center;
            padding: .2rem;
            margin-bottom: .2rem;
            border-radius: .2rem;

            -webkit-user-select: none;
            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;
        }

            width: 2.3rem;
            height: 2.3rem;
            border-radius: .1rem;
            filter: contrast(97%);
        }

        .shangpin-info .detail {

        }

            display: inline-flex;
            align-items: center;
            height: .38rem;
            padding: 1px 1px 1px 0;
            box-sizing: border-box;
            background: linear-gradient(0deg, #ff753c, #ff4b42);
            border-radius: 2px;
            font-size: 0;
            font-family: Microsoft YaHei;
        }

        .shangpin-info .detail .ticket .value {

            font-size: .25rem;
            font-family: Microsoft YaHei;
        }

        .shangpin-info .detail .ticket .name {
            line-height: 1em;
            font-weight: 300;
            color: #fff;
        }

        .shangpin-info .detail .ticket .value {

            align-items: center;
            height: 100%;
            font-weight: 400;
            color: #ff4d42;
            background: #fff;
        }

        .shangpin-info .detail .price {

            font-family: PingFang SC;
            font-weight: 700;
            line-height: 1em;
        }

        }

            color: #f23015;

            text-overflow: ellipsis;

            margin-right: 2px;
        }

            align-items: center;
            font-size: .3rem;
            font-weight: 500;
            color: #000;
            margin: 0;
        }

            white-space: nowrap;
            text-overflow: ellipsis;

        }

        }

        }

            padding-left: .1rem;

            box-sizing: border-box;

            -moz-user-select: none;
            -ms-user-select: none;
            user-select: none;

            background: #ffefed;
            display: flex;
            justify-content: center;
            align-items: center;

            justify-content: space-between;
            align-items: flex-end;
        }

            font-size: .28rem;
            font-weight: 700;
            color: #bd1d14;

            align-items: center;

            cursor: pointer;
        }

        .shangpin-info .detail .footer .operation.sell-out {
            background: #eee;
            color: #ccc;
            cursor: default;
        }

        .shangpin-info-loading {
            text-align: center;
            padding: .4rem 0;
            color: #fff;
        }

        .shangpin-info-loading span {
            font-size: .24rem;
            color: currentColor;
            letter-spacing: .01rem;
        }

        .free-share {
            position: fixed;
            bottom: 0;
            width: 7.5rem;
            height: 1.76rem;
            background: linear-gradient(180deg, transparent, #5157ff 50%);

            box-sizing: border-box;
            z-index: 100;
            cursor: pointer;
        }

        .free-share #share_content {
            display: flex;
            align-items: center;
            justify-content: center;
            width: 6.22rem;
            height: .9rem;
            margin: auto;
            background: linear-gradient(180deg, #fff8e6, #fdeabf);
            border-radius: .45rem;
            text-align: center;

            line-height: 1em;
        }

            margin-top: .05rem;
            margin-right: .1rem;
            height: 1em;
        }

        .free-share #share_content #svg-icon .cls-1,
        .free-share #share_content #svg-icon .cls-2 {
            fill: none;
            stroke: currentColor;
            stroke-linejoin: round;
            stroke-width: 2px;
        }

        .free-share #share_content #svg-icon .cls-2 {
            stroke-linecap: round;
        }

        .free-loading {
            display: flex;
            justify-content: center;
            align-items: center;
            flex-direction: column;
            padding-top: .6rem;
        }

        .free-loading>p {
            font-size: .3rem;
            color: #fff;
            letter-spacing: .01rem;
            margin: .2rem 0 0;
        }

        .free-loading .la-line-scale {
            width: 1.6rem;
            height: 1.28rem;
            display: block;
            font-size: 0;
            color: #5157ff;
        }

        .free-loading .la-line-scale>div {
            display: inline-block;
            float: none;
            background-color: currentColor;
            border: 0 solid;
            width: .16rem;
            height: 1.28rem;

            animation: line-scale 1.2s ease infinite;
        }

            -webkit-animation-delay: -1.2s;
            animation-delay: -1.2s;
        }

            -webkit-animation-delay: -1.1s;
            animation-delay: -1.1s;
        }

            -webkit-animation-delay: -1s;
            animation-delay: -1s;
        }

        .free-loading .la-line-scale>div:nth-child(4) {
            -webkit-animation-delay: -.9s;
            animation-delay: -.9s;
        }

        .free-loading .la-line-scale>div:nth-child(5) {
            -webkit-animation-delay: -.8s;
            animation-delay: -.8s;
        }

        .free-container {
            min-height: 100vh;
            max-width: 7.5rem;
            background: #5157ff;
            padding-bottom: 1.76rem;
            margin: 0 auto;
            box-sizing: border-box;
        }

        .free-banner {
            width: 7.5rem;
            height: auto;
            display: block;
        }

        .rule {
            position: relative;
            display: block;
            width: 7.02rem;
            height: 2.61rem;
            padding: .75rem .1rem .1rem .28rem;
            box-sizing: border-box;
            margin: -.5rem auto 0;
            background: url(images/huodong.jpg);
            background-size: cover;
        }

        .rule .rule-box {
            height: 100%;
            overflow: auto;
        }

        .rule p {
            margin: 0;
            font-size: .22rem;
            font-family: PingFang SC;
            font-weight: 500;
            line-height: .4rem;
            color: #333;
        }

            width: 7.02rem;
            margin: .28rem auto 0;
            box-sizing: border-box;
            border-radius: 0 0 .23rem .23rem;
        }

        @-webkit-keyframes turn {
            0% {
                transform: rotate(0);
            }

            to {
                transform: rotate(1turn);
            }
        }

        @keyframes turn {
            0% {
                transform: rotate(0);
            }

            to {
                transform: rotate(1turn);
            }
        }

        @-webkit-keyframes line-scale {

            0%,
            40%,
            to {
                transform: scaleY(.4);
            }

            20% {
                transform: scaleY(1);
            }
        }

        @keyframes line-scale {

            0%,
            40%,
            to {
                transform: scaleY(.4);
            }

            20% {
                transform: scaleY(1);
            }
        }

    <template id="c-list-item">
        <div class="shangpin-info">
            <img v-lazy="item.pict_url+'_200x200.jpg'" v-if="item.pict_url+'_200x200.jpg'">
            <img src="images/loading.gif" alt="" v-else>
            <div class="detail">
                <div class="title">
                    <template v-if="'jd' !== type">
                        <img v-if="item.user_type === '1'" class="icon tm" src="images/tianmao.jpg" alt="">
                        <img v-else-if="item.user_type === '0'" class="icon tb" src="images/taobao.jpg" alt="">
                    </template>
                    <img v-else class="icon" src="images/jd.jpg" alt="">
                    <span>{{ item.title }}</span>
                </div>
                <div class="tm-icons" v-if="false">
                    <img v-if="item.user_type === '1'" class="icon tm" src="images/tianmao.jpg" alt="">
                    <img v-else-if="item.user_type === '0'" class="icon tb" src="images/taobao.jpg" alt="">
                </div>
                <div class="center">
                    <div class="ticket">
                        <span class="name">券</span><span class="value">￥{{ type !== "jd" ? item.coupon_info_money :
                            item.coupon_info_money }}</span>
                    </div>
                    <div class="ticket">
                        <span class="name">月销</span><span class="value">{{item.volume}}</span>
                    </div>
                    <span v-if="showShare" class="share" v-bind:id="'item' + item.tao_id"
                        v-on:click="share(item)">分享</span>
                </div>
                <div class="footer">

                    <div class="price" v-bind:class="{'has-share': showShare}">
                        <div class="discount">{{type !== "jd" ? "券后" : "礼金"}}：<strong>{{ Number(item.quanhou_jiage)
                                }}元</strong></div>
                        <div class="price-bottom">
                            <div class="origin">原价：{{ item.size }}元</div>
                        </div>
                    </div>
                    <span v-if="item.stock == 0" class="operation sell-out">已抢完</span>
                    <span v-else-if="item.stock == -1" class="operation sell-out">未开始</span>
                    <span v-else class="operation" v-on:click="buy(item)">立即购买</span>
                </div>
            </div>
        </div>
    </template>
    <script>
        Vue.component("list-item", {
            template: "#c-list-item",
            props: {
                item: Object,
                type: {
                    type: String,
                    default: "tb" // tb || jd
                },
                showShare: {
                    type: Boolean,
                    default: false
                }
            },
            methods: {
                share: function (item) {
                    this.$emit("share", item);
                },
                buy: function (item) {
                    this.$emit("buy", item);
                }
            }
        });
    </script>
    <template id="c-loading">

        <div class="free-loading">

    <script>
        Vue.component("scroll-nav", {
            template: "#scroll-nav",
            props: {
                list: {
                    type: Array,
                    required: true
                },
                value: {
                    type: [String, Number],
                    required: true
                },
                valueKey: {
                    type: String,
                    default: "value"
                },
                labelKey: {
                    type: String,
                    default: "label"
                }
            },
            data: function () {
                return {
                    contentnavFixed: false,
                    opennavList: false,
                    activeValue: ""
                };
            },
            mounted: function () {
                this.activeValue = this.value;
                var self = this;
                window.addEventListener("click", function () {
                    self.opennavList = false;
                });
                setTimeout(function () {
                    var distanceTop = self.$refs.contentnav.getBoundingClientRect().top;
                    var mainnavHeight = self.$refs.contentnav.getBoundingClientRect().height;
                    window.addEventListener("scroll", function () {
                        //下拉加载
                        var scrollTop = document.documentElement.scrollTop || document.body.scrollTop;
                        // 当滑动距离大于等于分类距离顶部位置时，则固定定位
                        if (scrollTop >= distanceTop) {
                            self.contentnavFixed = true;
                            self.shopdetailsTop = mainnavHeight;
                            $(".header-addSearch").css("display", "none");
                        } else {
                            self.contentnavFixed = false;
                            self.shopdetailsTop = 0;
                            $(".header-addSearch").css("display", "block");
                        }
                    });
                }, 100);
            },
            watch: {
                value: function (n) {
                    this.activeValue = n;
                }
            },
            methods: {
                onclickcategoryNav: function (item, index) {
                    if (item[this.valueKey] === this.activeValue) return;
                    document.body.scrollTop > $(".header").height() && (document.body.scrollTop = $(".header").height());
                    document.documentElement.scrollTop > $(".header").height() && (document.documentElement.scrollTop = $(".header").height());
                    this.activeValue = item[this.valueKey];
                    this.$emit("update:value", this.activeValue);
                    this.$emit("change", this.activeValue);
                    // 整条分类的宽度
                    var mainnav_w = this.$refs.contentnav.offsetWidth;
                    // 获取单个元素宽度
                    var navli_w = this.$refs.ranklistli[index].offsetWidth;
                    // 居中的元素距离左右两边的宽度
                    var nav_distance = (mainnav_w - navli_w) / 2;
                    // 被点击元素距离左边的距离
                    var navli_left = parseInt(this.$refs.ranklistli[index].offsetLeft);
                    var part_nav_width = this.$refs.partnav.offsetWidth;
                    var part_nav_list_width = this.$refs.partnavlist.offsetWidth;
                    var nav_offsetLeft = "";
                    if (navli_left <= nav_distance) {
                        nav_offsetLeft = 0;
                    } else if (nav_distance - navli_left <= part_nav_width - part_nav_list_width) {
                        nav_offsetLeft = part_nav_width - part_nav_list_width;
                    } else {
                        nav_offsetLeft = nav_distance - navli_left;
                    }
                    $(".partnavlist").animate({
                        "left": nav_offsetLeft
                    }, 300);
                    if (this.opennavList) {
                        this.opennavList = false;
                    }
                },
                /**
                 * 滑动开始
                 */
                toushStart: function (e) {
                    x1 = e.targetTouches[0].pageX;
                    y1 = e.targetTouches[0].pageY;
                    part_nav_list_left = this.$refs.partnavlist.offsetLeft;
                },
                /**
                 * 滑动结束
                 */
                touMove: function (e) {
                    var x2 = e.targetTouches[0].pageX;
                    var y2 = e.targetTouches[0].pageY;
                    var part_nav_width = this.$refs.partnav.offsetWidth;
                    var part_nav_list_width = this.$refs.partnavlist.offsetWidth;
                    if (part_nav_list_left + x2 - x1 >= 0) {
                        $(".partnavlist").css("left", 0);
                    } else if (part_nav_list_left + x2 - x1 <= part_nav_width - part_nav_list_width) {
                        $(".partnavlist").css("left", part_nav_width - part_nav_list_width);
                    } else {
                        $(".partnavlist").css("left", part_nav_list_left + x2 - x1);
                    }
                    if (Math.abs(y2 - y1) > 0) {
                        e.preventDefault();
                    }
                },
                /**
                 * 展开所有分类
                 */
                openList: function () {
                    this.opennavList = !this.opennavList;
                },
            }
        });
    </script>
